import React from 'react';
import { Router, Route } from 'react-router-dom';
import './style/App.css'
import StreamCreate from './components/streams/StreamCreate'
import StreamList from './components/streams/StreamList'
import StreamShow from './components/streams/StreamShow'
import StreamEdit from './components/streams/StreamEdit'
import StreamDelete from './components/streams/StreamDelete'
import Header from './components/Header'
import history from './history'
import './style/App.css'

class App extends React.Component {


  render() {

    return(
      <div className="ui container">

          <Router history={history}>
          <div>
            {/* fix error link outside router */}
          <Header/>
          <Route path='/' exact component={StreamList}/>
          <Route path='/streams/Add' exact component={StreamCreate}/>
          <Route path='/streams/remove' exact component={StreamDelete}/>
          <Route path='/streams/view' exact component={StreamShow}/>
          :
          <Route path='/streams/update/:id' exact component={StreamEdit}/>
          </div>
          </Router>
        </div>

    )

}
}




export default App;
